import React from "react";

const Monday = ({breakfastRecipes}) => {

    const breakfast = breakfastRecipes.map((recipe) => {
        return(
            <div key={recipe._id}>
                <p>{recipe.name}</p>
            </div>
        );
    });
    return(
        <>
        <p>Monday Menu</p>
        {breakfast}
        </>
    );

}

export default Monday;
